import React, { useState, useEffect } from "react";
import axios from "axios";
import { useNavigate, NavLink } from "react-router-dom";

const HistoryPage = () => {
  const [diagnosisHistory, setDiagnosisHistory] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    const fetchDiagnosisHistory = async () => {
      const token = localStorage.getItem("token");
      if (!token) {
        console.error("No token found. Please log in again.");
        navigate("/login");
        return;
      }

      try {
        const response = await axios.get(
          "http://localhost:5000/diagnosis-history",
          {
            headers: { Authorization: `Bearer ${token}` },
          }
        );
        setDiagnosisHistory(response.data);
      } catch (error) {
        console.error("Error fetching diagnosis history:", error);
      }
    };

    fetchDiagnosisHistory();
  }, [navigate]);

  return (
    <div>
      {/* Internal CSS */}
      <style>{`
        body, html {
          margin: 0;
          padding: 0;
          font-family: 'Arial', sans-serif;
          background-color: #f9f9f9;
          box-sizing: border-box;
        }
        .container {
          display: flex;
          min-height: 100vh;
        }
        .sidebar {
          width: 250px;
          background-color: #1f2937;
          color: #ffffff;
          padding: 20px;
          display: flex;
          flex-direction: column;
          justify-content: space-between;
        }
        .sidebar h1 {
          font-size: 24px;
          font-weight: bold;
          margin-bottom: 20px;
          color: #10b981;
        }
        .sidebar ul {
          list-style: none;
          padding: 0;
          margin: 0;
        }
        .sidebar ul li {
          margin-bottom: 15px;
        }
        .sidebar ul li a {
          color: #ffffff;
          text-decoration: none;
          font-size: 16px;
          transition: color 0.3s;
        }
        .sidebar ul li a:hover,
        .sidebar ul li a.active {
          color: #10b981;
        }
        main {
          flex: 1;
          padding: 20px;
          display: flex;
          flex-direction: column;
          background-color: #f3f4f6;
          border-left: 1px solid #e5e7eb;
        }
        header {
          display: flex;
          justify-content: space-between;
          align-items: center;
          margin-bottom: 20px;
          border-bottom: 1px solid #e5e7eb;
          padding-bottom: 10px;
        }
        header h2 {
          font-size: 22px;
          color: #1f2937;
          margin: 0;
        }
        .user-profile img {
          width: 40px;
          height: 40px;
          border-radius: 50%;
          border: 2px solid #10b981;
        }
        .cards {
          display: grid;
          grid-template-columns: repeat(auto-fill, minmax(250px, 1fr));
          gap: 20px;
        }
        .card {
          background-color: #ffffff;
          border: 1px solid #e5e7eb;
          border-radius: 8px;
          box-shadow: 0 4px 10px rgba(0, 0, 0, 0.05);
          overflow: hidden;
          transition: transform 0.3s, box-shadow 0.3s;
          padding: 15px;
          text-align: center;
        }
        .card:hover {
          transform: scale(1.03);
          box-shadow: 0 6px 15px rgba(0, 0, 0, 0.1);
        }
        .card img {
          width: 100%;
          max-width: 200px;
          max-height: 200px;
          border-radius: 8px;
          margin-bottom: 10px;
          object-fit: cover;
        }
        .history-details {
          font-size: 14px;
          color: #4b5563;
          line-height: 1.5;
        }
        .history-details p {
          margin: 5px 0;
        }
        .history-details p:first-child {
          font-weight: bold;
          color: #1f2937;
        }
      `}</style>

      <div className="container">
        <aside className="sidebar">
          <h1>CallDash</h1>
          <ul>
            <li><NavLink to="/dashboard">Dashboard</NavLink></li>
            <li><NavLink to="/history">History</NavLink></li>
          </ul>
        </aside>
        <main>
          <header>
            <h2>Diagnosis History</h2>
            <div className="user-profile">
              <img src="https://via.placeholder.com/40" alt="User" />
            </div>
          </header>
          <section className="cards">
            {diagnosisHistory.length > 0 ? (
              diagnosisHistory.map((record) => (
                <div key={record._id} className="history-item card">
                  <img
                    src={record.imageUrl || "https://via.placeholder.com/200"}
                    alt="Diagnosis"
                  />
                  <div className="history-details">
                    <p>
                      Disease: {record.disease?.label || "Unknown"} <br />
                      Confidence:{" "}
                      {record.disease?.score
                        ? `${(record.disease.score * 100).toFixed(2)}%`
                        : "N/A"}
                    </p>
                    <p>Date: {new Date(record.createdAt).toLocaleString()}</p>
                  </div>
                </div>
              ))
            ) : (
              <p>No diagnosis history found.</p>
            )}
          </section>
        </main>
      </div>
    </div>
  );
};

export default HistoryPage;
